    select distinct granularity
    from MD.FATPAY_DASHBOARD_HELP_TABLE
    where {{granularity}}
          AND granularity is not null
),

filtered_fatpay as (
    select *
    from MART.FATPAY
    where -- IS_CARD_BINDING = FALSE and IS_REPEAT = FALSE and 
        STATUS_NAME = 'error' and
        {{CREATED_AT}}
        and {{CARD_GEOSCHEME}}
        and {{CARD_COUNTRY}}
        and {{STATUS}}
        and {{BUSINESS_NAME}}
        and {{USER_NAME}}
        and {{FIAT_CURRENCY}}
