        and {{CARD_BRAND}}
        and {{PAYMENT_TERMINAL}}
        and {{ERROR_GROUP}}
        and {{ERROR_NAME}}
        and {{HAS_ID_PROVIDER}}
        and {{SHOP}}
        and {{is_aft}}
