),

count_groups as (
    select 
        case 
            when STATUS_NAME='error' then concat('Error: ', GROUP_ERROR)
            when STATUS_NAME in('complete') then 'Successful: complete transaction'
            when STATUS_NAME in('void') then 'Merchant Void transaction'
            else 'other statuses'
        end as group_name,
        count(distinct ORDER_ID) as n_groups
    from filtered_fatpay
    group by grouping sets (
        (), (1)
    )
),

count_total as (
    select 
        count(distinct ORDER_ID) as n_total
    from filtered_fatpay
)

select 
    case when n_groups<n_total then group_name else 'Total transactions' end as group_name, 
    n_groups, 
    n_groups/n_total as share
from count_groups
left join count_total
    on 1 = 1
order by n_groups DESC

